import React from "react";
import stickersData from "./AuctionStikers-data";

function Time(props){
  const index = props.index;
  const stickersDataIndex = stickersData[index];
  const time = stickersDataIndex.time.slice(':');
  return(
    <div>
      <span>Окончание через:</span>
      <div>
        <span>{time[0].toFixed(2)}</span>
        <span>Час</span>
      </div>
    </div>

  )
}

export default Time
